function saveCSV(e){let t=e.target.files[0];Papa.parse(t,{header:!0,complete:function(e){console.log(e.data),sessionStorage.setItem("csv",JSON.stringify(e.data)),sessionStorage.setItem("step",3),window.location.href="/third_step"}})}document.addEventListener("DOMContentLoaded",(()=>{document.querySelector("#csv").addEventListener("change",saveCSV)}));